import { Button } from '@progress/kendo-react-buttons';

const layoutStyle = {
  textAlign:'center'
};

const Layout = props => (
  <div style={layoutStyle}>
    <p>This is formatted.</p>
    {props.children}
    <button>Previous</button>
	<button>Next</button>
  </div>
);

export default Layout;
